['Hello! This is a reupload because some of you expressed the graphs were misleading, and I agreed. The tiny bars were animated not to scale as an artistic choice, but in the interest of accuracy we decided to take the video down and change that. I hope you enjoy learning something from this video, or it at least sparks a desire to research and learn more!

Edit: Reuploaded again because the first comment wasn't "first"', 'I think that hydrogen may be the future but one of the problems is that hydrogen i highly flammable so as petroleum and diesel!', 'Interesting theoretical analysis.  Would have been nice to see something about what really drives decisions to go EV, Fuel Cell, or stay with carbon (including LNG):  COST!  What are the comparative costs of ownership and 12K/yr use (for a typical 4 or 5 year period) between these potential competitors?', "Diane - I love your channel but a lot of your technical discussion and technical specs presented here are flat wrong. Ex. Your cited efficiency losses for H2 suggested that PEMs would be a more efficient way to produce hydrogen. No, the PEM is the fuel cell unit that converts H2 and O into electricity. More so, the weight difference at 400 miles you cited was 1500KG at 400 miles range. That's mostly completely flat wrong. That weight differential might be that much in the case of the Hummer EV (a ridiculous and criminally inefficient vehicle). But for most vehicles the weight differential will be closer to 25%-30% more.", '11:43 whats her ig', 'Enjoyed this!...Its was very interesting and informative!', '@6:09 "Batteries lose capacity over time" Fuel cells rely on a buffer battery ... which also "loses capacity over time". Automotive fuel cells have a lifetime comparable to automotive batteries. They too die eventually.
@7:08 Nice diagram ... from _2009_!!! The Tesla Model S weighs 2100kg, not 3000kg. The 2022 Mirai XLE weighs 1900kg, not 1300kg. The Model S does 0-100km/h in 3s, the Mirai needs 9s!
