@9:19 "Infrastructure" Every single hydrogen station that gets built equals a bunch of superchargers that didn't get built! BEVs are established, there are many car manufacturers out there, and they won't go away ("New battery technologies coming? Don't worry, you still use the same old chargers that are everywhere."). How many hydrogen car manufacturers are there ... besides Toyota?!

